export default class props extends Component {
  render() {
    return (
      <div>

      <h1>Buy {props.name}</h1>
     <p>description:{props.description}</p>
      <p>{props.image}</p>
      <p>{props.price}</p>
      <p>{props.review}</p>
      </div>
    )
  }
}
